    [],nt"revision_timestamp": "2013-03-14T19:48:49.378806",nt"name": "surface-waters-information-management-system-swims",nt"isopen":
    false,nt"url": null,nt"notes": "The Surface Waters Information Management
    System (SWIMS) has been designed to meet multi-agency hydrologic database needs
    for Kansas. The SWIMS project was supported and funded by the Kansas GIS Policy
    Board in 1992 to develop an enhanced digital, attributed hydrologic network for
    the State and to integrate selected water quality, regulatory, and monitoring datasets
    with the hydrologic network. SWIMS was developed from EPA's RF3 dataset, a digital
    cartographic hydrologic database.",nt"license_title": null,nt"extras":
